import React, { useEffect, useState } from "react";
import { CarTypeInterface } from "./Components/CarTypeInterface";
import CarTypeContext from "./Components/CarTypeContext";
import CarTypeComp from "./Components/CarTypeComp";
import { ProductInterface } from "./Components/Interfaces/ProductInterface";
import { ManufacturerInterface } from "./Components/Interfaces/ManufacturerInterface";
import { modelInterface } from "./Components/Interfaces/ModelInterface";
import ModelInp from "./Components/ModelInp";
import Manufacturer from "./Components/Manufacturer";
import ProductComponent from "./Components/Product";
import "bootstrap/dist/css/bootstrap.css";
import "./Data/Pages.css";

// interface Category {
//   category_id: number;
//   category_type: number;
//   has_icon: number;
//   title: string;
//   seo_title: string;
//   vehicle_types: number[];

// }

const App: React.FC = () => {
  const [categories, setCategories] = useState<CarTypeInterface[]>([]);
  const [cartegory, setCartegory] = useState<number>(0);

  const [manArr, setManArr] = useState<ManufacturerInterface[]>([]);
  const [currentMan, setCurrentMan] = useState<ManufacturerInterface[]>([]);

  //should get man id and then fetch from
  const [modelArr, setModelArr] = useState<modelInterface[]>([]);
  const [chosenModel, setChosen] = useState<number>(0);
  const [products, setProducts] = useState<ProductInterface[]>([]);

  //-------------------------------------------------------//
  const [currentPage, setCurrentPage] = useState(1);
  const itemsPerPage = 5;

  const totalPage = Math.ceil(products.length / itemsPerPage);

  const fetchCategories = async (): Promise<void> => {
    try {
      const response: Response = await fetch(
        "https://api2.myauto.ge/ka/cats/get"
      );
      const data = await response.json();
      setCategories(data.data);
    } catch (error) {
      console.error("Error while fetching categories", error);
    }
  };

  const fetchManufacturers = async (): Promise<void> => {
    try {
      const response: Response = await fetch(
        "https://static.my.ge/myauto/js/mans.json"
      );
      const data = await response.json();
      setManArr(data);
    } catch (error) {
      console.error("Error while fetching categories", error);
    }
  };
  const fetchProducts = async (): Promise<void> => {
    try {
      let page = 1;
      let hasMorePages = true;

      while (hasMorePages) {
        const response: Response = await fetch(
          `https://api2.myauto.ge/ka/products/?page=${page}`
        );
        const data = await response.json();

        if (data.data.items.length > 0) {
          // Append the fetched products to your state
          setProducts((prevProducts) => [...prevProducts, ...data.data.items]);
          page++;
        } else {
          hasMorePages = false; // stop the loop when there are no more items
        }
      }
    } catch (error) {
      console.error("Error while fetching products", error);
    }
  };

  useEffect(() => {
    fetchProducts();
    fetchCategories();
    fetchManufacturers();
  }, []);

  // const productsToDisplay = products.slice(
  //   (currentPage - 1) * itemsPerPage,
  //   currentPage * itemsPerPage
  // );

  const handlePageClick = (pageNum: number) => setCurrentPage(pageNum);

  // console.log(categories.length)
  if (categories.length === 0) {
    return <div>LOADING</div>;
  } else {
    return (
      <div className="App">
        <CarTypeContext.Provider
          value={{
            categories,
            setCategories,
            cartegory,
            setCartegory,
            manArr,
            setManArr,
            currentMan,
            setCurrentMan,
            modelArr,
            setModelArr,
            chosenModel,
            setChosen,
          }}
        >
          {/* <CarTypeComp></CarTypeComp>
          <ModelInp></ModelInp>
          <Manufacturer></Manufacturer>
           */}
          <div className="container">
            {productsToDisplay.map((product) => {
              return (
                <>
                  <div className="row">
                    <ProductComponent product={product} />
                  </div>
                </>
              );
            })}
            <div className="pages">
              {currentPage > 1 && (
                <>
                  <span
                    className="d-flex p-12px cursor-pointer"
                    onClick={() => handlePageClick(1)}
                  >
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="13.414"
                      height="8.829"
                      viewBox="0 0 13.414 8.829"
                    >
                      <g transform="translate(1 1.414)">
                        <path
                          d="M12,12,9,9l3-3"
                          transform="translate(-1 -6)"
                          style={{
                            fill: "none",
                            stroke: "rgb(253, 65, 0)",
                            strokeLinecap: "round",
                            strokeWidth: "2px",
                            strokeLinejoin: "round",
                          }}
                        ></path>
                        <path
                          d="M12,12,9,9l3-3"
                          transform="translate(-6 -6)"
                          style={{
                            fill: "none",
                            stroke: "rgb(253, 65, 0)",
                            strokeLinecap: "round",
                            strokeWidth: "2px",
                            strokeLinejoin: "round",
                          }}
                        ></path>
                        <line
                          y2="6"
                          transform="translate(0)"
                          style={{
                            fill: "none",
                            stroke: "rgb(253, 65, 0)",
                            strokeLinecap: "round",
                            strokeWidth: "2px",
                          }}
                        ></line>
                      </g>
                    </svg>
                  </span>
                  <span
                    className="d-flex p-12px cursor-pointer"
                    onClick={() => handlePageClick(currentPage - 1)}
                  >
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="5.414"
                      height="8.829"
                      viewBox="0 0 5.414 8.829"
                    >
                      <path
                        d="M12,12,9,9l3-3"
                        transform="translate(-8 -4.586)"
                        style={{
                          fill: "none",
                          stroke: "rgb(253, 65, 0)",
                          strokeLinecap: "round",
                          strokeLinejoin: "round",
                          strokeWidth: "2px",
                        }}
                      ></path>
                    </svg>
                  </span>
                </>
              )}
              {[...Array(totalPage)].map((_, idx) => {
                const pageNumber = idx + 1;
                let startPage = 1;
                if (currentPage > 4) {
                  startPage = currentPage - 3;
                }
                if (currentPage < totalPage - 3 && startPage + 6 > totalPage) {
                  startPage = totalPage - 6;
                }
                if (pageNumber >= startPage && pageNumber < startPage + 7) {
                  return (
                    <button
                      className={`buttons${
                        pageNumber === currentPage ? " active" : ""
                      }`}
                      key={pageNumber}
                      onClick={() => handlePageClick(pageNumber)}
                    >
                      {pageNumber}
                    </button>
                  );
                }
                return null;
              })}
              {currentPage < totalPage && (
                <>
                  <span
                    className="d-flex p-12px cursor-pointer"
                    onClick={() => handlePageClick(currentPage + 1)}
                  >
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="5.414"
                      height="8.829"
                      viewBox="0 0 5.414 8.829"
                    >
                      <path
                        d="M9,12l3-3L9,6"
                        transform="translate(-7.586 -4.586)"
                        style={{
                          fill: "none",
                          stroke: "rgb(253, 65, 0)",
                          strokeLinecap: "round",
                          strokeLinejoin: "round",
                          strokeWidth: "2px",
                        }}
                      ></path>
                    </svg>
                  </span>
                  <span
                    className="d-flex p-12px cursor-pointer"
                    onClick={() => handlePageClick(totalPage)}
                  >
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="13.414"
                      height="8.829"
                      viewBox="0 0 13.414 8.829"
                    >
                      <g transform="translate(-1134.586 -2682.586)">
                        <path
                          d="M9,12l3-3L9,6"
                          transform="translate(1127 2678)"
                          style={{
                            fill: "none",
                            stroke: "rgb(253, 65, 0)",
                            strokeLinecap: "round",
                            strokeWidth: "2px",
                            strokeLinejoin: "round",
                          }}
                        ></path>
                        <path
                          d="M9,12l3-3L9,6"
                          transform="translate(1132 2678)"
                          style={{
                            fill: "none",
                            stroke: "rgb(253, 65, 0)",
                            strokeLinecap: "round",
                            strokeWidth: "2px",
                            strokeLinejoin: "round",
                          }}
                        ></path>
                        <line
                          y2="6"
                          transform="translate(1147 2684)"
                          style={{
                            fill: "none",
                            stroke: "rgb(253, 65, 0)",
                            strokeLinecap: "round",
                            strokeWidth: "2px",
                          }}
                        ></line>
                      </g>
                    </svg>
                  </span>
                </>
              )}
            </div>
          </div>
        </CarTypeContext.Provider>
      </div>
    );
  }
};

export default App;
